/*Table structure for table `t_organization_copy` */

DROP TABLE IF EXISTS `t_organization_copy`;

CREATE TABLE `t_organization_copy` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(32) DEFAULT '' COMMENT '机构编号',
  `fullname` varchar(100) DEFAULT '' COMMENT '机构名称',
  `simplename` varchar(32) DEFAULT '' COMMENT '机构简称',
  `pid` varchar(32) DEFAULT '' COMMENT '父级编号',
  `px` int(11) DEFAULT '0' COMMENT '排序',
  `sfyx` tinyint(1) DEFAULT '0' COMMENT '是否有效',
  `jzlb` int(11) DEFAULT '0' COMMENT '警种类别(1分局，2情报中心，3派出所,4刑侦大队,5视频大队,6技侦大队,7,网警大队,8图侦大队)，用于控制时间轴颜色',
  `pids` varchar(255) DEFAULT '' COMMENT '机构路径',
  `sub_num` int(11) DEFAULT '0' COMMENT '下级数量',
  `depth` int(11) DEFAULT '1' COMMENT '机构层级',
  `sfpcs` int(11) DEFAULT '0' COMMENT '是否派出所',
  `smbz` varchar(512) DEFAULT '' COMMENT '备注说明',
  `lrry` int(11) DEFAULT '0' COMMENT '录入人员',
  `lrsj` datetime DEFAULT NULL COMMENT '录入时间',
  `xgry` int(11) DEFAULT '0' COMMENT '修改人员',
  `xgsj` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2381 DEFAULT CHARSET=utf8;

/*Data for the table `t_organization_copy` */

