/*Table structure for table `t_person` */

DROP TABLE IF EXISTS `t_person`;

CREATE TABLE `t_person` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `rylx` varchar(32) DEFAULT '' COMMENT '人员类型（需求接收人员、需求签收人员、xxx人员）',
  `ryjh` varchar(256) DEFAULT '' COMMENT '人员警号',
  `reference_id` varchar(256) DEFAULT '' COMMENT '引用id（需求表、线索表等的主键）',
  `smbz` varchar(512) DEFAULT '' COMMENT '说明备注',
  `lrry` int(11) DEFAULT '0' COMMENT '录入人员',
  `lrsj` datetime DEFAULT NULL COMMENT '录入时间',
  `xgry` int(11) DEFAULT '0' COMMENT '修改人员',
  `xgsj` datetime DEFAULT NULL COMMENT '修改人员',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

