/*Table structure for table `t_reply` */

DROP TABLE IF EXISTS `t_reply`;

CREATE TABLE `t_reply` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `reference_id` varchar(32) DEFAULT '' COMMENT '目标id',
  `xxlx` varchar(32) DEFAULT '' COMMENT '消息类型（需求、信息、线索）',
  `lxbh` varchar(32) DEFAULT '' COMMENT '类型编号',
  `fsry` varchar(32) DEFAULT '' COMMENT '发送人员',
