  `fsnr` datetime DEFAULT NULL COMMENT '发送内容',
  `hfry` varchar(32) DEFAULT '' COMMENT '回复人员',
  `hfdw` varchar(32) DEFAULT '' COMMENT '回复单位',
  `hfrq` datetime DEFAULT NULL COMMENT '回复日期',
  `hfnr` varchar(32) DEFAULT '' COMMENT '回复内容',
  `sffj` varchar(32) DEFAULT '' COMMENT '是否附件',
  `smbz` varchar(512) DEFAULT '' COMMENT '说明备注',
  `lrry` int(11) DEFAULT '0' COMMENT '录入人员',
  `lrsj` datetime DEFAULT NULL COMMENT '录入时间',
  `xgry` int(11) DEFAULT '0' COMMENT '修改人员',
  `xgsj` datetime DEFAULT NULL COMMENT '修改人员',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_reply` */

LOCK TABLES `t_reply` WRITE;

UNLOCK TABLES;

/*Table structure for table `t_trail` */

DROP TABLE IF EXISTS `t_trail`;

CREATE TABLE `t_trail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `gjbs` int(11) DEFAULT NULL COMMENT '轨迹标识',
  `gjdd` varchar(64) DEFAULT NULL COMMENT '轨迹地点',
  `gjzp` varchar(64) DEFAULT NULL COMMENT '轨迹照片',
  `smbz` varchar(256) DEFAULT NULL COMMENT '说明备注',
  `lrry` int(11) DEFAULT NULL COMMENT '录入人员',
  `lrsj` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '录入时间',
  `xgry` int(11) DEFAULT NULL COMMENT '修改人员',
  `xgsj` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

